import React,{Component} from 'react';
import projects from './projects/projects.js';

class project extends Component{
	render(){
		return(
				<div>
					<h2>The services we offer</h2>
					<div>
						{
							projects.map(project =>{
								return(
										<div>{project.title}</div>
									) ;
							})
						}
					</div>
				</div>
			)
	}
}

export default project;
